import "./App.css";
const Hello = (p) => {
  return (
    <div>
      <p>Hello World</p>
    </div>
  );
};

function App() {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello />
    </div>
  );
}

export default App;
